import AboutUs from 'components/about-us/AboutUs'
import React from 'react'
import Clients from '../../clients/Clients'
import Hero from '../../hero/Hero'
import { songs } from 'data/example'

const Home = () => {
  return (
    <div className="row">
      {songs.map(song=> console.log(song.title))}
      <Hero />
      <Clients />
      <AboutUs />
    </div>
  )
}

export default Home
